// src/components/Header.js
import React from 'react';
import { Link } from 'react-router-dom'; // Импортируем Link
import './Header.css'; // Подключаем стили для Header

const Header = () => {
  return (
    <header className="header">
      <nav className="nav">
        <Link to="/" className="nav-button">Главная</Link>
        <Link to="/about" className="nav-button">О клубе</Link>
        <Link to="/events" className="nav-button">Мероприятия</Link>
        <Link to="/forum" className="nav-button">Форум</Link>
        <Link to="/contacts" className="nav-button">Контакты</Link>
      </nav>
    </header>
  );
};

export default Header;
